description:
Week 25 of TEMPLATE, a new digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out. 

As of 10 AM ET on 10/2/2013, there are 24 HOURS LEFT to get a print copy of Volume 1 through our Kickstarter campaign! If you have any interest at all in a print version of Volume 1, know that this is the only run planned for the foreseeable future. So be sure to pledge!
